<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Таймер Табата</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;700&display=swap');

        body {
            font-family: 'Inter', sans-serif;
            background: #111827;
            color: #E5E7EB;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            text-align: center;
            padding: 1rem;
            box-sizing: border-box;
        }

        .container {
            width: 100%;
            max-width: 480px;
            display: flex;
            flex-direction: column;
            gap: 2rem;
        }

        .timer-display {
            position: relative;
            width: 100%;
            padding-bottom: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
        }

        .timer-svg {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            transform: rotate(-90deg);
        }

        .timer-circle {
            stroke: #374151;
            fill: transparent;
            stroke-width: 10;
        }

        .timer-progress {
            stroke-dasharray: 628;
            stroke-dashoffset: 628;
            stroke-linecap: round;
            transition: stroke-dashoffset 1s linear;
        }

        #timer-text {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 5rem;
            font-weight: 700;
        }

        .info-section {
            display: flex;
            flex-direction: column;
            gap: 0.5rem;
        }

        #exercise-name {
            font-size: 2.25rem;
            font-weight: 700;
            color: #F9FAFB;
        }

        #status-text {
            font-size: 1.5rem;
            color: #9CA3AF;
        }

        .control-buttons {
            display: flex;
            justify-content: center;
            gap: 1rem;
        }

        .control-button {
            padding: 1rem 2rem;
            font-size: 1.25rem;
            font-weight: 700;
            border-radius: 9999px;
            transition: transform 0.1s ease-in-out, background-color 0.2s;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .control-button:active {
            transform: scale(0.95);
        }

        .pulse-animation {
            animation: pulse 1s infinite;
        }

        @keyframes pulse {
            0% { transform: scale(1); opacity: 1; }
            50% { transform: scale(1.05); opacity: 0.8; }
            100% { transform: scale(1); opacity: 1; }
        }

        /* Color classes for different states */
        .color-prepare { stroke: #FBBF24; color: #FBBF24; }
        .color-exercise { stroke: #10B981; color: #10B981; }
        .color-rest { stroke: #60A5FA; color: #60A5FA; }
        .color-long-rest { stroke: #F472B6; color: #F472B6; }
        .color-shavasana { stroke: #A78BFA; color: #A78BFA; }
        .bg-start { background-color: #10B981; color: #F9FAFB; }
        .bg-reset { background-color: #EF4444; color: #F9FAFB; }
    </style>
</head>
<body>

<div class="container">
    <div class="info-section">
        <div id="status-text" class="uppercase">Начало тренировки</div>
        <div id="exercise-name">Готовы?</div>
    </div>
    <div class="timer-display">
        <svg class="timer-svg" viewBox="0 0 200 200">
            <circle class="timer-circle" cx="100" cy="100" r="95"></circle>
            <circle id="progress-circle" class="timer-progress" cx="100" cy="100" r="95"></circle>
        </svg>
        <span id="timer-text">--</span>
    </div>

    <div class="control-buttons">
        <button id="startButton" class="control-button bg-start">Начать</button>
        <button id="resetButton" class="control-button bg-reset hidden">Сброс</button>
    </div>
</div>
